INSERT INTO `guidance` VALUES ('伸展胸部肌肉',1,'/usr/local/tomcat/webapps/PoseProject/images/guidance/17.jpg','找一面墙或一个转角，将手肘提起到跟肩同高'),('伸展胸部肌肉',2,'/usr/local/tomcat/webapps/PoseProject/images/guidance/18.jpg','脚缓慢向前跨一步，可以感受到胸部肌肉慢慢地被拉伸'),('伸展颈部肌肉',1,'/usr/local/tomcat/webapps/PoseProject/images/guidance/15.jpg','用左手把头慢慢压向左侧'),('伸展颈部肌肉',2,'/usr/local/tomcat/webapps/PoseProject/images/guidance/16.jpg','感受到脖子右侧的肌肉正在慢慢地被伸展'),('坐式前屈',1,'/usr/local/tomcat/webapps/PoseProject/images/guidance/03.jpg','双脚根并拢，手抱住脚踝处，身体挺直'),('坐式前屈',2,'/usr/local/tomcat/webapps/PoseProject/images/guidance/04.jpg','慢慢向下压'),('头部倾斜拉伸',1,'/usr/local/tomcat/webapps/PoseProject/images/guidance/01.jpg','右手做一个反手摸肚脐的动作，用手背勾住腰，把右侧肩膀固定住'),('头部倾斜拉伸',2,'/usr/local/tomcat/webapps/PoseProject/images/guidance/02.jpg','左手放右侧头部，头向左倾斜，保持五秒。左手把头部拉紧，头向右用力，保持五秒，最后还原'),('夹紧肩胛骨',1,'/usr/local/tomcat/webapps/PoseProject/images/guidance/22.jpg','端坐在椅子上，脖子伸长，膝盖弯曲90度，双脚平放在地面'),('夹紧肩胛骨',2,'/usr/local/tomcat/webapps/PoseProject/images/guidance/23.jpg','两侧肩胛骨往中间夹紧，就好像要让它们互相触碰一样，想象它们正努力地夹着一个网球，保持3秒'),('夹紧肩胛骨',3,'/usr/local/tomcat/webapps/PoseProject/images/guidance/24.jpg','慢慢松开肩胛骨，让它们回到放松的姿势'),('按摩球放松枕肌',1,'/usr/local/tomcat/webapps/PoseProject/images/guidance/19.jpg','走到敞开的门口，挺胸站好'),('按摩球放松枕肌',2,'/usr/local/tomcat/webapps/PoseProject/images/guidance/20.jpg','右手靠着门的右侧放，手掌朝向门，手肘屈曲90度，前臂贴着门，右脚往前迈出一小步，会感觉到靠近腋窝的胸肌被拉紧'),('按摩球放松枕肌',3,'/usr/local/tomcat/webapps/PoseProject/images/guidance/21.jpg','换边进行'),('提肩',1,'/usr/local/tomcat/webapps/PoseProject/images/guidance/09.jpg','自然站立，双腿与肩同宽，双臂向两侧提起至与肩平行'),('提肩',2,'/usr/local/tomcat/webapps/PoseProject/images/guidance/10.jpg','双脚踩紧弹力带，腰背挺直，向上呼气，向下吸气'),('斜方肌拉伸运动',1,'/usr/local/tomcat/webapps/PoseProject/images/guidance/07.jpg','以右侧为例，左手抱住头'),('斜方肌拉伸运动',2,'/usr/local/tomcat/webapps/PoseProject/images/guidance/08.jpg','向左侧侧偏，并且头部要向右侧转动'),('牵引',1,'/usr/local/tomcat/webapps/PoseProject/images/guidance/13.jpg','右腿伸直，左手拉住拉伸辅助带的一端，另一端套在左脚上'),('牵引',2,'/usr/local/tomcat/webapps/PoseProject/images/guidance/14.jpg','左腿完全放松，呼气提腿，吸气还原'),('青蛙趴',1,'/usr/local/tomcat/webapps/PoseProject/images/guidance/05.jpg','像青蛙一样趴在地上，双腿打开向里扣，双脚贴紧'),('青蛙趴',2,'/usr/local/tomcat/webapps/PoseProject/images/guidance/06.jpg','腿蹬直后循环往复'),('髂腰肌动态拉伸',1,'/usr/local/tomcat/webapps/PoseProject/images/guidance/11.jpg','做弓箭步，收紧臀部'),('髂腰肌动态拉伸',2,'/usr/local/tomcat/webapps/PoseProject/images/guidance/12.jpg','通过臀部向前推和前脚位置逐渐前移，慢慢拉长跨度');
