INSERT INTO `movement` VALUES ('伸展胸部肌肉','找一面墙或一个转角，将手肘提起到跟肩同高，手掌到手肘顶着墙壁，与肩膀呈现约九十度。脚缓慢向前跨一步，可以感受到胸部肌肉慢慢地被拉伸，接着换边','/usr/local/tomcat/webapps/PoseProject/contents/Round shoulder - practice2.html'),('伸展颈部肌肉','用左手把头慢慢压向左侧，可以感受到脖子右侧的肌肉正在慢慢地被伸展。接着换边','/usr/local/tomcat/webapps/PoseProject/contents/Round shoulder - practice1.html'),('坐式前屈','双脚根并拢，手抱住脚踝处，身体挺直，慢慢向下压，再慢慢直起身体，会有拉伸的感觉，做完很放松','/usr/local/tomcat/webapps/PoseProject/contents/O_leg - practice3.html'),('头部倾斜拉伸','用右手做一个反手摸肚脐的动作，用手背勾住腰，把右侧肩膀固定住，然后左手放在右侧头部，头慢慢的向左倾斜，到最大幅度之后保持五秒，然后左手把头部拉紧，头向右用力，产生一个对抗的力，在这个位置上再保持五秒，最后还原','/usr/local/tomcat/webapps/PoseProject/contents/Head tilt - practice1.html'),('夹紧肩胛骨','端坐在椅子上。脖子伸长，膝盖弯曲90度，双脚平放在地面。两侧肩胛骨往中间夹紧，就好像要让它们互相触碰一样。保持3秒，想象它们正努力地夹着一个网球。慢慢松开肩胛骨，让它们回到放松的姿势','/usr/local/tomcat/webapps/PoseProject/contents/Cervical anteversion - practice7.html'),('按摩球放松枕肌','平躺在地上，脸朝上，把小球放在脖子下面，摆在颈椎的其中一侧，正对着颅骨底，左右摆动头部，让球在不同部位来回翻滚','/usr/local/tomcat/webapps/PoseProject/contents/Cervical anteversion - practice1.html'),('提肩','自然站立，双腿与肩同宽，双臂向两侧提起至与肩平行；双脚踩紧弹力带，腰背挺直，向上呼气，向下吸气；保持腹部收紧，双手握紧弹力带','/usr/local/tomcat/webapps/PoseProject/contents/hl shoulder - practice3.html'),('斜方肌拉伸运动','以右侧为例，左手抱住头，向左侧侧偏，并且头部要向右侧转动，以便能够完全拉伸到斜方肌','/usr/local/tomcat/webapps/PoseProject/contents/hl shoulder - practice1.html'),('牵引','右腿伸直，左手拉住拉伸辅助带的一端，另一端套在左脚上。脚尖处于自然姿态，不可绷直或勾起，左腿完全放松，呼气提腿，吸气还原。大腿后侧有强烈的牵拉感','/usr/local/tomcat/webapps/PoseProject/contents/X_leg - practice4.html'),('青蛙趴','像青蛙一样趴在地上，双腿打开向里扣，双脚贴紧（一开始可能会有难度），但效果也是最好的','/usr/local/tomcat/webapps/PoseProject/contents/O_leg - practice4.html'),('髂腰肌动态拉伸','做弓箭步，收紧臀部，背部不要反弓，骨盆不要前倾。通过臀部向前推和前脚位置逐渐前移，慢慢拉长跨度，这样来回几次，感受髂腰肌的拉伸','/usr/local/tomcat/webapps/PoseProject/contents/X_leg - practice1.html');
/*!40000 ALTER TABLE `movement` ENABLE KEYS */;
